$(function(){
    /*('a[href*=#]') */
    var navLinks = $('.desplazar');
        navLinks.on('click', function(e) {
          e.preventDefault();
          $('html, body').animate(
            { 
                scrollTop: $($(this).attr('href')).offset().top
            }, 500, 'linear');
        });
});
